  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rydell
  National Wildlife Refuge summarizes Refuge activities during the 2001 fiscal year.
  The report begins with an introduction to the Refuge and a summary of the yearu2019s
  highlights and climatic conditions. Information about monitoring and studies- including
  surveys and censuses- is provided next. Habitat restoration and management projects
  are also covered; activities include upland restoration, water level management,
  haying, farming, timber management, prescribed burning, and vegetation control.
  Fish and wildlife management is discussed next with emphasis on bird banding and
  nest structures. Coordination activities, such as interagency coordination, tribal
  coordination, and Friends organizations, are outlined. The resource protection section
  provides information about law enforcement, wildfire preparedness, cultural resource
  management, and land acquisition. Information about public education and recreation
  is given including visitor services and outreach. Finally, comprehensive management
  planning and general administration are discussed in the Refuge planning and administration
  section.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
